 @Nclake5485  I think what the other people are getting at is that the detective work was never the crux. It was a jumping off point or a linking thread. It was there, but the case was always solved as the clues came in. The audience was never guided to wonder about the case like a crime novel would have them. We didn’t feel as if we were investigating the case with Batman, it was always us watching him solve it. 

The earlier approach worked for many movies because the conflict wasn’t focused on how the case was solved but more what the solution entailed. We would follow leads but the audience wasn’t really expected to follow the trail and get that “AHAH” moment when we finally put it together. There was detective work but not for audience, the audience’s interest was always on the antagonist’s plot, not so much figuring out the plot, but just seeing it unfold and how batman would combat it. 

The intrigue was in how to combat the plot but not how to reach it.

